import React from 'react'


function Parallax
() {
  return (
    <React.Fragment>

<h1 className='display-1'>Parallax</h1>

<img alt="this_is_my_image" height="fit" width="fit" src="https://c4.wallpaperflare.com/wallpaper/912/256/892/landscape-forest-deer-artwork-wallpaper-preview.jpg"/>

</React.Fragment>
  )
}

export default Parallax
